tables.table_schema:
CREATE TABLE commuter_traffic (
    id INT PRIMARY KEY,
    station_name VARCHAR(50),
    timestamp TIMESTAMP,
    daily_visitors INT
);

CREATE TABLE stations (
    station_id UUID PRIMARY KEY,
    station_name VARCHAR(255) NOT NULL,
    station_location VARCHAR(255) NOT NULL
);

CREATE TABLE commuters (
    commuter_id UUID PRIMARY KEY,
    commuter_name VARCHAR(255) NOT NULL,
    commuter_age INT,
    commuter_gender VARCHAR(10)
);

CREATE TABLE commuter_traffic (
    commuter_id INT,
    station_id INT,
    entry_time TIMESTAMP,
    exit_time TIMESTAMP
);

CREATE TABLE stations (
    station_id INT PRIMARY KEY,
    station_name VARCHAR(255),
    location_lat DECIMAL(10, 8),
    location_long DECIMAL(11, 8)
);

CREATE TABLE Commuter_Stations (
    station_id INT PRIMARY KEY,
    station_name VARCHAR(255),
    city VARCHAR(100),
    state VARCHAR(50)
);

CREATE TABLE Commuter_Trains (
    train_id INT PRIMARY KEY,
    train_name VARCHAR(255),
    capacity INT,
    route VARCHAR(255)
);

CREATE TABLE Commuter_Passengers (
    passenger_id INT PRIMARY KEY,
    passenger_name VARCHAR(255),
    age INT,
    email VARCHAR(255)
);
